// Header.tsx
import React from 'react';
import './Header.css';
import Logo from '../../../../public/biblioteca-contato-seguro.png';

const Header: React.FC = () => {
  return (
    <header>
      <h1>Biblioteca da contato seguro</h1>
        <img src={Logo} />
    </header>
  );
};

export default Header;
